import Nav from "./Components/nav/Nav.js";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Nav />
        <p>
          Everything is working, surprisingly
        </p>
      </header>
    </div>
  );
}

export default App;
